import React from "react";
import Home from "./Home";
import TestDetail from "./TestDetail"
import GoodScore from "./GoodScore";
import GetAdmission from "./GetAdmission";
import Contact from './Contact';


import { Link} from 'react-router-dom';

const Route1=()=>
{
    return (
        <>
        
                <Link  to="/" element={<Home/>} />
                
                <Link exact path="/contact" element={<Contact/>} />
                
                <Link exact  path="/Testdetail" element={<TestDetail/>} />
            
                <Route exact path="/GoodScore" element={<GoodScore/>} />
            
                <Route exact  path="/Getadmission" element={<GetAdmission/>} />
         
        
        </>
    )
}

export default Route1;
